import React from 'react';

export default function Layout({ header, leftSidebar, main, rightSidebar, footer }) {
  return (
    <div style={{ display: 'flex', flexDirection: 'column', minHeight: '100vh', backgroundColor: '#000000' }}>
      <header style={{ padding: '1rem', color: '#ccc', backgroundColor: '#000000' }}>{header}</header>
      <div style={{ display: 'flex', flex: 1 }}>
        <aside
          style={{
            flex: '0 0 20%', // Left sidebar occupies 20% of the width
            padding: '1rem',
            backgroundColor: '#000000',
          }}
        >
          {leftSidebar}
        </aside>
        <main
          style={{
            flex: '1 1 60%', // Main content occupies 60% of the width
            padding: '1rem',
            backgroundColor: '#000000',
            color: '#ccc',
          }}
        >
          {main}
        </main>
        <aside
          style={{
            flex: '0 0 20%', // Right sidebar occupies 20% of the width
            padding: '1rem',
            backgroundColor: '#000000',
          }}
        >
          {rightSidebar}
        </aside>
      </div>
      <footer style={{ padding: '1rem', color: '#ccc', backgroundColor: '#000000' }}>{footer}</footer>
    </div>
  );
}
